import { useState } from 'react';
import './Grade.css'
export default function BotRating() {
  const [rating, setRating] = useState(0);

  const handleClick = (value) => {
    setRating(value);
    alert(`Вы поставили боту оценку ${value} ⭐`);
    // Здесь можно отправить оценку на сервер или обработать по-другому
  };

  return (
    <div className="rating-container">
      <h3 className="text-lg font-semibold mb-4">Насколько полезен наш бот?</h3>
      <div className="stars flex justify-center gap-2">
        {[1, 2, 3, 4, 5].map((value) => (
          <span
            key={value}
            onClick={() => handleClick(value)}
            className={`cursor-pointer text-3xl transition-colors ${
              value <= rating ? 'text-yellow-400' : 'text-gray-400'
            }`}
          >
            ★
          </span>
        ))}
      </div>
    </div>
  );
}
